INSERT INTO `wp_options` VALUES (174,'mec_custom_msg_2_html','<link rel = \"stylesheet\" type = \"text/css\" href = \"https://webnus.net/modern-events-calendar/addons-api/mec-extra-content/style.css\" /><div class=\"mec-custom-msg-notification-set-box extra\"><div class=\"w-row mec-custom-msg-notification-wrap\"><div class=\"w-col-sm-12\"><div class=\"w-clearfix w-box mec-cmsg-2-notification-box-wrap mec-new-addons-wrap\"><div class=\"w-box-head\">Announcement<span><i class=\"mec-sl-close\"></i></span></div><div class=\"w-box-content\"><div class=\"mec-addons-notification-box-image\"> <img src=\"https://webnus.net/modern-events-calendar/addons-api/mec-extra-content/zoom-integration-addon-banner.png\" /></div><div class=\"mec-addons-notification-box-content mec-new-addons\"><div class=\"w-box-content\"><div class=\"mec-addons-notification-title\">Zoom Integration Addon</div><p>With this add-on you can show your users the information regarding your meetings and webinars. Provide the users with an embedded code of your event link plus username and password. You can choose whether they should be able to see this information after the reservation or be shown to everyone. You can also send this information via email after the reservation is done. Put a badge on shortcodes and single events to make them stand out.</p><strong>Key Features:</strong><div class=\"mec-addons-key-features\"><ul><li>Import/Export Zoom Webinars</li><li>Import/Export Zoom Meetings</li><li>View Embedded</li><li>Email Placeholders</li><li>View In Single Event</li><li>View In Shortcodes</li></ul></div><div style=\"clear:both\"></div><a href=\"https://webnus.net/modern-events-calendar/addons/zoom-integration/?ref=17\" target=\"_blank\">Read More</a></div></div></div></div></div></div></div>','yes');
