INSERT INTO `wp_options` VALUES (179,'mec_custom_msg_html','<link rel = \"stylesheet\" type = \"text/css\" href = \"https://webnus.net/modern-events-calendar/addons-api/mec-extra-content/style.css\" /><div class=\"mec-custom-msg-notification-set-box extra\"><div class=\"w-row mec-custom-msg-notification-wrap\"><div class=\"w-col-sm-12\"><div class=\"w-clearfix w-box mec-cmsg-notification-box-wrap mec-new-addons-wrap\"><div class=\"w-box-head\">Announcement<span><i class=\"mec-sl-close\"></i></span></div><div class=\"w-box-content\"><div class=\"mec-addons-notification-box-image\"> <img src=\"https://webnus.net/modern-events-calendar/addons-api/mec-extra-content/divi-single-builder-addon-banner.png\" /></div><div class=\"mec-addons-notification-box-content mec-new-addons\"><div class=\"w-box-content\"><div class=\"mec-addons-notification-title\">Divi Single Builder Addon</div><p>With the help of this add-on, you will be able to create a ready-made template for all your events, add styles that you like to your single events, and change the layout in Divi page builder with a single drag and drop. Also, if there is a widget that you do not like, you can delete it and use other widgets in the single event of your website. You can use all the widgets of the single event separately and create any section that you want with whatever size that you want. You can also set an animation for each widget.</p><strong>Key Features:</strong><div class=\"mec-addons-key-features\"><ul><li>Creating Templates</li><li>Active Alongside Other Page Builders</li><li>Unique Styling</li><li>Activate On MEC Lite</li></ul></div><div style=\"clear:both\"></div><a href=\"https://webnus.net/modern-events-calendar/addons/divi-single-builder/?ref=17\" target=\"_blank\">Read More</a></div></div></div></div></div></div></div>','yes');
