INSERT INTO `wp_posts` VALUES (39,1,'2020-10-21 03:46:23','2020-10-21 03:46:23','<p><em>Deze voorstelling wordt georganiseerd door Stichting Intocht Sinterklaas (SIS) met medewerking van DJ Piet En Show en CHentertainment.</em></p>\n<p>Sinterklaas en zijn Pieten met een spannend avontuur in een prachtig Schouwburg. Dat doet velen van ons wellicht terugdenken aan Sinfé. Ken jij het nog uit je basisschool jaren? Alle leerlingen werden destijds met de bus naar het theater gebracht.</p>\n<p>Dar werd in een prachtige ambiance een show opgevoerd die diepe indruk achterliet. Het mooiste was dat alle kinderen na afloop nog een cadeautje meekregen. Dit was vaak een beker, bord, bestek of een placemat en was altijd voorzien van het Sinfé logo met het bekende Sinterklaasje.</p>\n<p>In het kader van 800 jaar stad gaan we weer terug naar die tijd. Hoe mooi is het bovendien dat er ook 600 gratis kaarten beschikbaar worden gesteld (zolang de voorraad strekt).</p>\n<p>De Stichting Intocht Sinterklaas brengt i.s.m. DJ Piet en Show (DJPS) en CHentertainment dat mooie moment weer terug naar het theater, en natuurlijk zorgen we ook voor die belangrijke afsluiter: het cadeautje!</p>\n<p>Maar dat is nog niet alles, want de show wordt fantastisch, met een grote band, danseressen, licht en geluid, mooie decors maar ook tal van activiteiten voor en na de show in de foyer. Denk daarbij aan op de foto met de Pieten, dansen met DJ Piet op een echte verlichte dansvloer, knutselen en spelletjes. Het wordt één groot feest en het zal de kinderen aan niets ontbreken. Zij worden meegenomen in een spannend verhaal en helemaal losgaan op de klanken van de Pietenband. De show heeft ook een hoog musicalgehalte, en ja zelfs Sinterklaas zal zingend op het podium staan.</p>\n','Sinterklaas en de jarige stad! (2021)','','publish','closed','closed','','kookkunst-delicees-theatrale-8-gangen-proeverij','','','2020-10-21 03:46:23','2020-10-21 03:46:23','',0,'http://eagerlytest.local/events/kookkunst-delicees-theatrale-8-gangen-proeverij/',0,'mec-events','',0);
